         else if (fifo_pop_dout[WIDTH_SID-1:WIDTH_ID]==MID7) WGRANT = 20'h80;
         else if (fifo_pop_dout[WIDTH_SID-1:WIDTH_ID]==MID8) WGRANT = 20'h100;
         else if (fifo_pop_dout[WIDTH_SID-1:WIDTH_ID]==MID9) WGRANT = 20'h200;
         else if (fifo_pop_dout[WIDTH_SID-1:WIDTH_ID]==MID10) WGRANT = 20'h400;
         else if (fifo_pop_dout[WIDTH_SID-1:WIDTH_ID]==MID11) WGRANT = 20'h800;
         else if (fifo_pop_dout[WIDTH_SID-1:WIDTH_ID]==MID12) WGRANT = 20'h1000;
         else if (fifo_pop_dout[WIDTH_SID-1:WIDTH_ID]==MID13) WGRANT = 20'h2000;
         else if (fifo_pop_dout[WIDTH_SID-1:WIDTH_ID]==MID14) WGRANT = 20'h4000;
         else if (fifo_pop_dout[WIDTH_SID-1:WIDTH_ID]==MID15) WGRANT = 20'h8000;
         else if (fifo_pop_dout[WIDTH_SID-1:WIDTH_ID]==MID16) WGRANT = 20'h10000;
         else if (fifo_pop_dout[WIDTH_SID-1:WIDTH_ID]==MID17) WGRANT = 20'h20000;
         else if (fifo_pop_dout[WIDTH_SID-1:WIDTH_ID]==MID18) WGRANT = 20'h40000;
         else if (fifo_pop_dout[WIDTH_SID-1:WIDTH_ID]==MID19) WGRANT = 20'h80000;
         else WGRANT = 20'h0;
     end // if
     end // always
     // synopsys translate_off
     `ifdef RIGOR
     always @ (negedge ACLK or negedge ARESETn) begin
          if (ARESETn==1'b1) begin
              if (fifo_pop_valid&~|WGRANT) begin
                  $display("%04d %m ERROR FIFO valid, but none granted WGRANT", $time);
              end
          end
     end
     `endif
     // synopsys translate_on
     //-----------------------------------------------------------
     function [NUM-1:0] priority_sel;
     input    [NUM-1:0] request;
     begin
          casex (request)
          20'bxxxxxxxxxxxxxxxxxxx1: priority_sel = 20'h1;
          20'bxxxxxxxxxxxxxxxxxx10: priority_sel = 20'h2;
          20'bxxxxxxxxxxxxxxxxx100: priority_sel = 20'h4;
          20'bxxxxxxxxxxxxxxxx1000: priority_sel = 20'h8;
          20'bxxxxxxxxxxxxxxx10000: priority_sel = 20'h10;
          20'bxxxxxxxxxxxxxx100000: priority_sel = 20'h20;
          20'bxxxxxxxxxxxxx1000000: priority_sel = 20'h40;
          20'bxxxxxxxxxxxx10000000: priority_sel = 20'h80;
          20'bxxxxxxxxxxx100000000: priority_sel = 20'h100;
          20'bxxxxxxxxxx1000000000: priority_sel = 20'h200;
          20'bxxxxxxxxx10000000000: priority_sel = 20'h400;
          20'bxxxxxxxx100000000000: priority_sel = 20'h800;
          20'bxxxxxxx1000000000000: priority_sel = 20'h1000;
          20'bxxxxxx10000000000000: priority_sel = 20'h2000;
          20'bxxxxx100000000000000: priority_sel = 20'h4000;
          20'bxxxx1000000000000000: priority_sel = 20'h8000;
          20'bxxx10000000000000000: priority_sel = 20'h10000;
          20'bxx100000000000000000: priority_sel = 20'h20000;
          20'bx1000000000000000000: priority_sel = 20'h40000;
          20'b10000000000000000000: priority_sel = 20'h80000;
          default:   priority_sel = 20'h0;
          endcase
     end
     endfunction
     //-----------------------------------------------------------
endmodule
