module axi_arbiter_stom_s30
     #(parameter NUM=30) // num of slaves
(
       input  wire           ARESETn
     , input  wire           ACLK
     //-----------------------------------------------------------
     , input  wire  [NUM:0]  BSELECT  // selected by comparing trans_id
     , input  wire  [NUM:0]  BVALID
     , input  wire  [NUM:0]  BREADY
     , output wire  [NUM:0]  BGRANT
     //-----------------------------------------------------------
     , input  wire  [NUM:0]  RSELECT  // selected by comparing trans_id
     , input  wire  [NUM:0]  RVALID
     , input  wire  [NUM:0]  RREADY
     , input  wire  [NUM:0]  RLAST
     , output wire  [NUM:0]  RGRANT
);
     //-----------------------------------------------------------
     // read-data arbiter
     //-----------------------------------------------------------
     reg [NUM:0] rgrant_reg;
     //-----------------------------------------------------------
     localparam STR_RUN    = 'h0,
                STR_WAIT   = 'h1;
     reg stateR=STR_RUN;
     always @ (posedge ACLK or negedge ARESETn) begin
           if (ARESETn==1'b0) begin
               rgrant_reg  <= 'h0;
               stateR      <= STR_RUN;
           end else begin
               case (stateR)
               STR_RUN: begin
                    if (|RGRANT) begin
                       if (~|(RGRANT&RREADY&RLAST)) begin
                           rgrant_reg <= RGRANT;
                           stateR     <= STR_WAIT;
                       end
                    end
                    end // STR_RUN
               STR_WAIT: begin
                    if (|(RGRANT&RVALID&RREADY&RLAST)) begin
                        rgrant_reg <= 'h0;
                        stateR     <= STR_RUN;
                    end
                    end // STR_WAIT
               endcase
           end
     end
     //-----------------------------------------------------------
     assign RGRANT = (stateR==STR_RUN) ? priority_sel(RSELECT&RVALID)
                                       : rgrant_reg;
     //-----------------------------------------------------------
     // write-response arbiter
     //-----------------------------------------------------------
     reg [NUM:0] bgrant_reg;
     localparam STB_RUN    = 'h0,
                STB_WAIT   = 'h1;
     reg stateB=STB_RUN;
     always @ (posedge ACLK or negedge ARESETn) begin
           if (ARESETn==1'b0) begin
               bgrant_reg  <= 'h0;
               stateB      <= STB_RUN;
           end else begin
               case (stateB)
               STB_RUN: begin
                    if (|BGRANT) begin
                       if (~|(BGRANT&BREADY)) begin
                           bgrant_reg <= BGRANT;
                           stateB     <= STB_WAIT;
                       end
                    end
                    end // STB_RUN
               STB_WAIT: begin
                    if (|(BGRANT&BVALID&BREADY)) begin
                        bgrant_reg <= 'h0;
                        stateB     <= STB_RUN;
                    end
                    end // STB_WAIT
               endcase
           end
     end
     //-----------------------------------------------------------
     assign BGRANT = (stateB==STB_RUN) ? priority_sel(BSELECT&BVALID)
                                       : bgrant_reg;
     //-----------------------------------------------------------
     function [NUM:0] priority_sel;
        input [NUM:0] request;
     begin
          casex (request)
          31'bxxxxxxxxxxxxxxxxxxxxxxxxxxxxxx1: priority_sel = 31'h1;
          31'bxxxxxxxxxxxxxxxxxxxxxxxxxxxxx10: priority_sel = 31'h2;
          31'bxxxxxxxxxxxxxxxxxxxxxxxxxxxx100: priority_sel = 31'h4;
          31'bxxxxxxxxxxxxxxxxxxxxxxxxxxx1000: priority_sel = 31'h8;
          31'bxxxxxxxxxxxxxxxxxxxxxxxxxx10000: priority_sel = 31'h10;
          31'bxxxxxxxxxxxxxxxxxxxxxxxxx100000: priority_sel = 31'h20;
          31'bxxxxxxxxxxxxxxxxxxxxxxxx1000000: priority_sel = 31'h40;
          31'bxxxxxxxxxxxxxxxxxxxxxxx10000000: priority_sel = 31'h80;
          31'bxxxxxxxxxxxxxxxxxxxxxx100000000: priority_sel = 31'h100;
          31'bxxxxxxxxxxxxxxxxxxxxx1000000000: priority_sel = 31'h200;
          31'bxxxxxxxxxxxxxxxxxxxx10000000000: priority_sel = 31'h400;
          31'bxxxxxxxxxxxxxxxxxxx100000000000: priority_sel = 31'h800;
          31'bxxxxxxxxxxxxxxxxxx1000000000000: priority_sel = 31'h1000;
          31'bxxxxxxxxxxxxxxxxx10000000000000: priority_sel = 31'h2000;
          31'bxxxxxxxxxxxxxxxx100000000000000: priority_sel = 31'h4000;
          31'bxxxxxxxxxxxxxxx1000000000000000: priority_sel = 31'h8000;
          31'bxxxxxxxxxxxxxx10000000000000000: priority_sel = 31'h10000;
          31'bxxxxxxxxxxxxx100000000000000000: priority_sel = 31'h20000;
          31'bxxxxxxxxxxxx1000000000000000000: priority_sel = 31'h40000;
          31'bxxxxxxxxxxx10000000000000000000: priority_sel = 31'h80000;
          31'bxxxxxxxxxx100000000000000000000: priority_sel = 31'h100000;
          31'bxxxxxxxxx1000000000000000000000: priority_sel = 31'h200000;
          31'bxxxxxxxx10000000000000000000000: priority_sel = 31'h400000;
          31'bxxxxxxx100000000000000000000000: priority_sel = 31'h800000;
          31'bxxxxxx1000000000000000000000000: priority_sel = 31'h1000000;
          31'bxxxxx10000000000000000000000000: priority_sel = 31'h2000000;
          31'bxxxx100000000000000000000000000: priority_sel = 31'h4000000;
          31'bxxx1000000000000000000000000000: priority_sel = 31'h8000000;
          31'bxx10000000000000000000000000000: priority_sel = 31'h10000000;
          31'bx100000000000000000000000000000: priority_sel = 31'h20000000;
          31'b1000000000000000000000000000000: priority_sel = 31'h40000000;
          default: priority_sel = 31'h0;
          endcase
     end
     endfunction
     //-----------------------------------------------------------
endmodule
